!function() {
    'use strict';

    var keypad = [
            [1, 2, 3],
            [4, 5, 6],
            [7, 8, 9]
        ],
        // instructions = [
        //     'ULL',
        //     'RRDDD',
        //     'LURDL',
        //     'UUUUD'
        // ],
        instructions = `



`,
        code = '',
        currentPos = [1, 1],
        edge = 2;

    function parseInstructions() {
        instructions = instructions.split('\n');
    }

    function getNewPos(origin, instruction) {
        let pos = origin;

        for (let move of instruction) {
            if (move === 'U') {
                if (pos[1] > 0)
                    pos[1]--;
            } else if (move === 'R') {
                if (pos[0] < edge)
                    pos[0]++;
            } else if (move === 'D') {
                if (pos[1] < edge)
                    pos[1]++;
            } else if (move === 'L') {
                if (pos[0] > 0)
                    pos[0]--;
            }
        }

        return pos;
    }

    function readCode() {
        for (let instruction of instructions) {
            currentPos = getNewPos(currentPos, instruction);

            code += keypad[currentPos[1]][currentPos[0]];
        }
    }

    parseInstructions();
    readCode();

    console.log('code', code);
}();